-- ----------------------------
-- Table structure for oms_order
-- ----------------------------
DROP TABLE IF EXISTS `oms_order`;
CREATE TABLE `oms_order`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `member_id` bigint(20) NOT NULL COMMENT '会员id',
  `receiver_member_id` bigint(20) DEFAULT NULL COMMENT '领取会员',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店长id',
  `coupon_id` bigint(20) DEFAULT NULL COMMENT '优惠卷id',
  `order_sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `total_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '订单总金额',
  `profits` double(10, 4) NOT NULL COMMENT '订单利润',
  `pay_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '应付金额(实际支付金额)',
  `refund_amount` double(10, 4) NOT NULL COMMENT '退款金额',
  `freight_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '运费金额',
  `integral_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '积分抵扣金额',
  `flash_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '秒杀优惠金额',
  `gifts_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '赠品优惠金额',
  `coupon_amount` double(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '优惠券抵扣金额',
  `status` int(11) NOT NULL COMMENT '订单状态：0->待付款;1->待发货;2->待收货;3->已完成;4->已关闭;5->待领取;6->已退款',
  `is_gift` int(11) NOT NULL COMMENT '是否赠送订单: 0->否;1->是;',
  `delete_status` int(11) NOT NULL DEFAULT 0 COMMENT '删除状态：0->未删除；1->已删除',
  `logo_status` int(11) DEFAULT 0 COMMENT '标识状态(0->未标识;1->已标识)',
  `delivery_type` int(11) DEFAULT NULL COMMENT '提货方式：0->自提；1->物流',
  `receiver_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人姓名',
  `receiver_phone` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人电话',
  `receiver_detail_address` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '详细地址',
  `note` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单备注',
  `pay_trade_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '支付流水编号',
  `out_trade_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '外部支付编号',
  `payment_time` datetime(0) DEFAULT NULL COMMENT '支付时间',
  `delivery_time` datetime(0) DEFAULT NULL COMMENT '发货时间',
  `receive_time` datetime(0) DEFAULT NULL COMMENT '确认收货时间',
  `modify_time` datetime(0) DEFAULT NULL COMMENT '修改时间',
  `create_time` datetime(0) NOT NULL COMMENT '提交时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 935 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of oms_order
-- ----------------------------

