  `directly_profits` double(15, 4) DEFAULT 0.0000 COMMENT '直推奖励',
  `indirect_id` bigint(20) DEFAULT NULL COMMENT '间推会员',
  `indirect_profits` double(15, 4) DEFAULT NULL COMMENT '间推奖励',
  `group_id` bigint(20) DEFAULT NULL COMMENT '团长id',
