  `channel_bonus` double(15, 4) DEFAULT NULL COMMENT '渠道商分红',
  `up_orderId` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '外部订单编号',
  `auto_end_time` int(10) NOT NULL COMMENT '默认完结时间间隔(分钟)',
  `modify_time` datetime(0) DEFAULT NULL COMMENT '修改时间',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
