DROP TABLE IF EXISTS `pms_product`;
CREATE TABLE `pms_product`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `product_category_id` bigint(20) DEFAULT NULL COMMENT '商品分类id',
  `name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商品图片',
  `product_sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '货号',
  `delete_status` int(11) DEFAULT NULL COMMENT '删除状态：0->未删除；1->已删除',
  `publish_status` int(11) DEFAULT NULL COMMENT '上架状态:0->下架;1->上架',
  `new_status` int(11) DEFAULT NULL COMMENT '新品状态:0->不是新品;1->新品',
  `recommand_status` int(11) DEFAULT NULL COMMENT '推荐状态:0->不推荐;1->推荐',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `sale` int(11) DEFAULT NULL COMMENT '销量',
  `price` double(15, 4) DEFAULT NULL COMMENT '价格',
  `cost_price` double(15, 4) DEFAULT NULL COMMENT '成本价',
  `original_price` double(15, 4) DEFAULT NULL COMMENT '市场价',
  `description` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '商品描述',
  `preview_status` int(11) DEFAULT NULL COMMENT '是否为预告商品:0->不是;1->是',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '关键字',
  `album_pics` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '画册图片，连产品图片限制为5张，以逗号分割',
  `detail_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '详细标题',
  `detail_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '详细描述',
  `detail_mobile_html` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '移动端网页详情',
  `product_attribute_category_id` bigint(20) DEFAULT NULL COMMENT '商品属性分类id',
  `stock` int(11) DEFAULT NULL COMMENT '库存',
  `low_stock` int(11) DEFAULT NULL COMMENT '库存预警值',
  `promotion_start_time` datetime(0) DEFAULT NULL COMMENT '促销开始时间',
  `promotion_end_time` datetime(0) DEFAULT NULL COMMENT '促销结束时间',
  `promotion_per_limit` int(11) DEFAULT NULL COMMENT '活动限购数量',
  `promotion_type` int(1) DEFAULT NULL COMMENT '促销类型：0->没有促销使用原价;1->使用促销价；2->使用会员价；3->使用阶梯价格；4->使用满减价格；5->限时购',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 220 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品信息' ROW_FORMAT = Dynamic;

