INSERT INTO `pms_product` VALUES (47, 69, '高山娃娃菜', 'http://bbcfqn.zuizhezhi.com/1597219357893高山娃娃.jpg', '', 0, 0, 0, 0, 5, 47, 4.2800, 3.5000, 5.3500, '娃娃菜：是一种精细，小个的小白菜。又名上汤娃娃菜“、”“嫩白菜”、“微型小白菜”。营养价值跟大白菜一样，口感稚嫩，可与金针菇等搭配，做汤等。', 0, '', 'http://bbcfqn.zuizhezhi.com/1597286723045高山娃娃.jpg,http://bbcfqn.zuizhezhi.com/1597286727712高山娃娃菜.jpg,http://bbcfqn.zuizhezhi.com/1597286769812acd9d7e2e492c822b2067ff4711595.jpg', '', '', '<p>娃娃菜：是一种精细，小个的小白菜。又名上汤娃娃菜&ldquo;、&rdquo;&ldquo;嫩白菜&rdquo;、&ldquo;微型小白菜&rdquo;。营养价值跟大白菜一样，口感稚嫩，可与金针菇等搭配，做汤等。</p>\n<p>存储方式：冷藏。</p>\n<p><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://bbcfqn.zuizhezhi.com/1597219395019高山娃娃菜.jpg\" /><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://bbcfqn.zuizhezhi.com/1597219400553高山娃娃菜.jpg\" /><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://bbcfqn.zuizhezhi.com/1597219403829高山娃娃菜.jpg\" /><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://bbcfqn.zuizhezhi.com/1597219407248娃娃.png\" /></p>', 20, 479, 0, NULL, NULL, NULL, NULL);
