INSERT INTO `pms_product` VALUES (49, 69, '云南飘儿白 ', 'http://bbcfqn.zuizhezhi.com/1596011098139.jpg', 'YNPEB01', 0, 0, 0, 0, 0, 29, 2.8800, 2.4000, 3.6000, '', 0, '', 'http://bbcfqn.zuizhezhi.com/1596011102526.jpg,http://bbcfqn.zuizhezhi.com/1596011106616.jpg', '', '', '<p>云南飘儿白：主要来源云南，梗短，呈碧绿色，叶子鲜嫩，水分充足，没有枯黄叶。偶尔会出现少量虫洞、虫眼，属于正常现象。</p>\n<p>运输中，可能会造成少量叶子脱落，或压伤，属于正常现象，可以正常食用。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://bbcfqn.zuizhezhi.com/1596011217127159109109298.jpg\" /><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://bbcfqn.zuizhezhi.com/1596011220110159109111349.jpg\" /></p>\n<p><img class=\"wscnph\" style=\"max-width: 100%;\" src=\"http://qn.zuizhezhi.com/1591091129627.jpg\" /></p>\n<p>&nbsp;</p>', 20, 500, 0, NULL, NULL, NULL, NULL);
